('1154', 'eng', 'superadmin', TIMESTAMP '2018-12-10 11:42:52.994', NULL, TRUE, NULL, NULL, NULL, 'Consent', 'txt', STRINGDECODE('I understand that the data collected about me during pre-registration by the said authority includes my -  \n\u2022                     Name\n\u2022                     Date of birth\n\u2022                     Gender\n\u2022                     Address\n\u2022                     Contact details\n\u2022                     Documents\nI also understand that this information will be stored and processed for the purpose of verifying my identity in order to access various services, or to comply with a legal obligation. I give my consent for the collection of this data for this purpose.'), NULL, '10001', 'Pre-Registration', 'Consent', 'consent'),
('1154', 'ara', 'superadmin', TIMESTAMP '2018-12-10 11:42:52.994', NULL, TRUE, NULL, NULL, NULL, STRINGDECODE('\u0645\u0648\u0627\u0641\u0642\u0629'), 'txt', STRINGDECODE('\u0648\u0623\u0646\u0627 \u0623\u0641\u0647\u0645 \u0623\u0646 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u0645 \u062c\u0645\u0639\u0647\u0627 \u0639\u0646\u064a \u062e\u0644\u0627\u0644 \u0627\u0644\u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u0645\u0633\u0628\u0642 \u0645\u0646 \u0642\u0628\u0644 \u0627\u0644\u0633\u0644\u0637\u0629 \u0627\u0644\u0645\u0630\u0643\u0648\u0631\u0629 \u062a\u0634\u0645\u0644 \u0628\u0644\u062f\u064a -\n\u2022 \u0627\u0644\u0627\u0633\u0645\n\u2022 \u062a\u0627\u0631\u064a\u062e \u0627\u0644\u0645\u064a\u0644\u0627\u062f\n\u2022 \u0646\u0648\u0639 \u0627\u0644\u062c\u0646\u0633\n\u2022 \u0627\u0644\u0639\u0646\u0648\u0627\u0646\n\u2022 \u062a\u0641\u0627\u0635\u064a\u0644 \u0627\u0644\u0627\u062a\u0635\u0627\u0644\n\u2022 \u0627\u0644\u0648\u062b\u0627\u0626\u0642\n\u0643\u0645\u0627 \u0623\u0641\u0647\u0645 \u0623\u0646\u0647 \u0633\u064a\u062a\u0645 \u062a\u062e\u0632\u064a\u0646 \u0647\u0630\u0647 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0648\u0645\u0639\u0627\u0644\u062c\u062a\u0647\u0627 \u0628\u063a\u0631\u0636 \u0627\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u0647\u0648\u064a\u062a\u064a \u0645\u0646 \u0623\u062c\u0644 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u062e\u062f\u0645\u0627\u062a \u0645\u062e\u062a\u0644\u0641\u0629\u060c \u0623\u0648 \u0627\u0644\u0627\u0645\u062a\u062b\u0627\u0644 \u0644\u0627\u0644\u062a\u0632\u0627\u0645 \u0642\u0627\u0646\u0648\u0646\u064a. \u0648\u0623\u0648\u0627\u0641\u0642 \u0639\u0644\u0649 \u062c\u0645\u0639 \u0647\u0630\u0647 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0644\u0647\u0630\u0627 \u0627\u0644\u063a\u0631\u0636.'), NULL, '10001', STRINGDECODE('\u0645\u0627 \u0642\u0628\u0644 \u0627\u0644\u062a\u0633\u062c\u064a\u0644'), STRINGDECODE('