('1154', 'fra', 'superadmin', TIMESTAMP '2018-12-10 11:42:52.994', NULL, TRUE, NULL, NULL, NULL, 'Consentement', 'txt', STRINGDECODE('Je comprends que les donn\u00e9es recueillies \u00e0 mon sujet lors de la pr\u00e9-enregistr\u00e8rent par ladite autorit\u00e9 comprennent mon -\n\u2022                     nom\n\u2022                     Date de naissance\n\u2022                     genre\n\u2022                     adresse\n\u2022                     coordonn\u00e9es\n\u2022                     Documents\nJe comprends \u00e9galement que ces informations seront stock\u00e9es et trait\u00e9es dans le but de v\u00e9rifier mon identit\u00e9 afin d''acc\u00e9der \u00e0 divers services, ou de se conformer \u00e0 une obligation l\u00e9gale. Je donne mon consentement pour la collecte de ces donn\u00e9es \u00e0 cette fin.'), NULL, '10001', STRINGDECODE('Pr\u00e9-inscription'), 'Consentement', 'consent');     
