an>\n</div>\n</td>\n</tr>\n\n<tr>\n<td rowspan=\"1\">\n<div class=\"block top-buffer\">\n<label class=\"name-head-color\"><b>Rendez-vous amoureux/\u062a\u0627\u0631\u064a\u062e&nbsp;:&nbsp;</b></label>\n<span>$!dateOfBirth</span>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\">\n<div class=\"block top-buffer\">\n<label class=\"name-head-color\"><b>Le sexe&nbsp;:&nbsp;</b></label> <span>$!gender_eng</span>\n&nbsp;&nbsp; <label class=\"name-head-color\"><b>\u062c\u0646\u0633&nbsp;:&nbsp;</b></label>\n<span>$!gender_ara</span>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"3\">\n<div class=\"row\" style=\"margin-right: 0px; margin-left: -10px;\">\n<div class=\"col-md-2 top-buffer\">\n<div class=\"block top-buffer\">\n<table>\n<tr>\n<td><label class=\"name-head-color\"><b>Adresse&nbsp;:&nbsp;</b></label>\n</td>\n<td><span>$!addressLine1_eng, $!addressLine2_eng,\n\t\t$!addressLine3_eng, $!region_eng, $!province_eng, $!city_eng,\n\t\t$!postalCode </span></td>\n</tr>\n<tr>\n<td><label class=\"name-head-color\"><b>\u0639\u0646\u0648\u0627\u0646&nbsp;:&nbsp;</b></label>\n</td>\n<td><span>$!addressLine1_ara, $!addressLine2_ara,\n\t\t$!addressLine3_ara, $!region_ara, $!province_ara, $!city_ara,\n\t\t$!postalCode </span>\n</td>\n</tr>\n</table>\n</div>\n</div>\n</div>\n</td>\n</tr>\n</table>\n<div>&nbsp;</div>\n<table class=\"main-table\" style=\"height: 300px\">\n<tr>\n<td>\n<div style=\"margin-left: 10px; margin-right: 10px; border: solid black 1px; height: 250px; width: 250px;\">\n<div class=\"col-md-6\">\n<div class=\"bar-code-padding\"></div>\n<img src=$!QrCode style=\"width: 250px; height: 250px; margin-top: -20px\">\n</div>\n</div>\n</td>\n<td>\n<div class=\"name-head-color col-md-6\">\n<br> Pour toute question s''il vous pla\u00eet contactez-nous au<br>\n<br> Inscription Processor, Hanging Gardens, Global Village\nParc technologique, Mysore Rd, RVCE, Bangalore, Karnataka 560059<br>\n<br> \u0644\u0623\u064a\u0629 \u0645\u0634\u0627\u0643\u0644 \u064a\u0631\u062c\u0649 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0628\u0646\u0627 \u0639\u0644\u0649 <br>\u0627\u0644\u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u0645\u0639\u0627\u0644\u062c\u060c\n\u0627\u0644\u062d\u062f\u0627\u0626\u0642 \u0627\u0644\u0645\u0639\u0644\u0642\u0629 \u060c \u0627\u0644\u0642\u0631\u064a\u0629 \u0627\u0644\u0639\u0627\u0644\u0645\u064a\u0629 Tech Park, Mysore Rd,RVCE 560059\n\u0628\u0646\u063a\u0627\u0644\u0648\u0631\u0648\u060c \u0643\u0627\u0631\u0646\u0627\u062a\u0627\u0643\u0627 <br>\n<br>\n</div>\n</td>\n</tr>\n</table>\n</body>\n</html>'), 'velocity', '10003', 'Processeur dinscription', STRINGDECODE('Mod\u00e8le de carte Masked UIN'), 'RPR_MASKED_UIN_CARD_TEMPLATE');        
