('1207', 'fra', 'superadmin', TIMESTAMP '2018-12-10 11:42:52.994', NULL, TRUE, NULL, NULL, NULL, STRINGDECODE('Demande de mise \u00e0 jour UIN plac\u00e9e avec succ\u00e8s SMS'), 'txt', STRINGDECODE('Bonjour $fullName_fra,\n\nVotre demande de \u00abmise \u00e0 jour UIN\u00bb a \u00e9t\u00e9 envoy\u00e9e avec succ\u00e8s. Votre RID (num\u00e9ro de demande) est $RID pour le suivi.\n\nMerci!'), 'velocity', '10006', 'Resident Services', STRINGDECODE('Demande de mise \u00e0 jour UIN plac\u00e9e avec succ\u00e8s SMS'), 'RS_UIN_UPDATE_SUCCESS_SMS'),
('1208', 'eng', 'superadmin', TIMESTAMP '2018-12-10 11:42:52.994', NULL, TRUE, NULL, NULL, NULL, 'UIN Update Request Failed Email', 'txt', STRINGDECODE('Hi $fullName_eng,\n\nWe were unable to process your \"UIN Update\" request. Please try again later.\n\nThank You!'), 'velocity', '10006', 'Resident Services', 'UIN Update Request Failed Email', 'RS_UIN_UPDATE_FAILURE_EMAIL'),
